ace your bid.<br />\n##JOB_LINK##<br />\n<br />\nThanks,<br />\n##SITE_NAME##<br />\n##SITE_URL##\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n		<table style=\"margin-top: 2px;\" width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td>\r\n					<p style=\" color: #000; font-size: 12px;text-align:center;line-height:16px;\">\r\n					<span style=\"color:#000;font-size:12px;text-align:center;margin:10px;font-weight: bold;\">It\'s time to turn your dreams into reality.</span><br><br><img style=\"width: 150px;padding-right: 15px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/logo.png\" alt=\"[Image: ##SITE_NAME##]\" /></p>\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n	 </div>\r\n	 </center>\r\n</div>', '##FAV_USERNAME## has added new job [##JOB_NAME##].', 'USERNAME,JOB_NAME,JOB_LINK,FAV_USERNAME', '0', '1', 'New job opened');
INSERT INTO `email_templates` VALUES ('52', '2015-07-02 16:11:45', '2015-04-11 08:44:14', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin Job Status Alert', 'we will send this when a job status change.', '[##SITE_NAME##][##JOB_NAME##] Status: ##OLD_STATUS## -> ##NEW_STATUS##', 'Hi,\n\nStatus was changed for job \"##JOB_NAME##\".\n\nStatus: ##OLD_STATUS## -> ##NEW_STATUS##\n\nPlease click the following link to view the job,\n##JOB_URL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##\n', '<div style=\"background: url(\'##SITE_URL##/images/login-background.jpg\');\">\r\n  <link href=\"http://fonts.googleapis.com/css?family=Open+Sans\" rel=\"stylesheet\" type=\"text/css\" />\r\n  <center><div style=\"margin: 5px 0pt; padding: 20px; width: 700px; font-family: Open Sans,sans-serif;background-repeat: no-repeat;-webkit-border-radius: 10px;-moz-border-radius: 10px;border-radius: 10px;\">\r\n	 <div style=\"border-bottom: 1px solid #ccc; margin: 0pt; background: -moz-linear-gradient(top, #fccd39 0%, #f49a2a 100%);\r\n		background: -webkit-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -o-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -ms-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#fccd39\', endColorstr=\'#f49a2a\',GradientType=0 ); \r\n		min-height: 70px;\">\r\n			<center><img style=\"margin-top: 15px;padding-right: 15px;width: 66px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/email.png\" alt=\"[Image: ##SITE_NAME##]\" /></center>\r\n	 </div>\r\n	 <div style=\"background: url(\'rose_bg2.png\') repeat;padding: 20px; background-color: #ffffff; box-shadow: 0 0 7px rgba(0, 0, 0, 0.067);\">\r\n		<table width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td style=\"padding: 20px 30px 5px;\">\r\n					Hi,<br />\n<br />\nStatus was changed for job \"##JOB_NAME##\".<br />\n<br />\nStatus: ##OLD_STATUS## -> ##NEW_STATUS##<br />\n<br />\nPlease click the following link to view the job,<br />\n##JOB_URL##<br />\n<br />\nThanks,<br />\n##SITE_NAME##<br />\n##SITE_URL##<br />\n\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n		<table style=\"margin-top: 2px;\" width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td>\r\n					<p style=\" color: #000; font-size: 12px;text-align:center;line-height:16px;\">\r\n					<span style=\"color:#000;font-size:12px;text-align:center;margin:10px;font-weight: bold;\">It\'s time to turn your dreams into reality.</span><br><br><img style=\"width: 150px;padding-right: 15px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/logo.png\" alt=\"[Image: ##SITE_NAME##]\" /></p>\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n	 </div>\r\n	 </center>\r\n</div>', null, 'OLD_STATUS,NEW_STATUS,JOB_NAME,JOB_URL,SITE_NAME,SITE_URL', '0', '0', 'Admin Job Status Alert');
