20px 30px 5px;\">\r\n					Hi ##FREELANCER##,<br />\n<br />\n##EMPLOYER## requested quote for ##CATEGORY_NAME##.<br />\n<br />\nRequest: ##REQUEST_TITLE##<br />\nDescription: ##REQUEST_DESCRIPTION##<br />\nTime: ##PREFERRED_TIME##<br />\nLocation: ##WORK_LOCATION##<br />\n<br />\nManage quote requests and works: ##MY_WORK_PAGE_LINK##<br />\n<br />\nThanks,<br />\n##SITE_NAME##<br />\n##SITE_URL##\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n		<table style=\"margin-top: 2px;\" width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td>\r\n					<p style=\" color: #000; font-size: 12px;text-align:center;line-height:16px;\">\r\n					<span style=\"color:#000;font-size:12px;text-align:center;margin:10px;font-weight: bold;\">It\'s time to turn your dreams into reality.</span><br><br><img style=\"width: 150px;padding-right: 15px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/logo.png\" alt=\"[Image: ##SITE_NAME##]\" /></p>\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n	 </div>\r\n	 </center>\r\n</div>', null, 'SITE_NAME, SITE_URL,FREELANCER,EMPLOYER,RESPONSE_URL,BUSINESSNAME,RESPONSE_URL', '0', '0', 'New Quote Request Received Notification');
