INSERT INTO `email_templates` VALUES ('78', '2016-01-20 16:11:45', '2016-01-20 16:11:45', '##FROM_EMAIL##', '', 'Start Skill Test Notification', 'we will send this mail, when freelancer paid fee for skill test.', 'Start your skill test - ##EXAM##', 'Hi ##USERNAME##,\r\n\r\nYour payment of skill test \"##EXAM##\" is received. \r\n\nPlease follow the below link to start skill test now. \r\n\n##EXAM_LINK##\r\n\nIf you already taken this exam please ignore this mail.\r\n\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', '<div style=\"background: url(\'##SITE_URL##/images/login-background.jpg\');\">\r\n  <link href=\"http://fonts.googleapis.com/css?family=Open+Sans\" rel=\"stylesheet\" type=\"text/css\" />\r\n  <center><div style=\"margin: 5px 0pt; padding: 20px; width: 700px; font-family: Open Sans,sans-serif;background-repeat: no-repeat;-webkit-border-radius: 10px;-moz-border-radius: 10px;border-radius: 10px;\">\r\n	 <div style=\"border-bottom: 1px solid #ccc; margin: 0pt; background: -moz-linear-gradient(top, #fccd39 0%, #f49a2a 100%);\r\n		background: -webkit-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -o-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -ms-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#fccd39\', endColorstr=\'#f49a2a\',GradientType=0 ); \r\n		min-height: 70px;\">\r\n			<center><img style=\"margin-top: 15px;padding-right: 15px;width: 66px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/email.png\" alt=\"[Image: ##SITE_NAME##]\" /></center>\r\n	 </div>\r\n	 <div style=\"background: url(\'rose_bg2.png\') repeat;padding: 20px; background-color: #ffffff; box-shadow: 0 0 7px rgba(0, 0, 0, 0.067);\">\r\n		<table width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td style=\"padding: 20px 30px 5px;\">\r\n					Hi ##USERNAME##,<br />\r\n<br />\r\nYour payment of skill test \"##EXAM##\" is received. <br />\r\n<br />\nPlease follow the below link to start skill test now. <br />\r\n<br />\n##EXAM_LINK##<br />\r\n<br />\nIf you already taken this exam please ignore this mail.<br />\r\n<br />\n\r<br />\nThanks,<br />\r\n##SITE_NAME##<br />\r\n##SITE_URL##\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n		<table style=\"margin-top: 2px;\" width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td>\r\n					<p style=\" color: #000; font-size: 12px;text-align:center;line-height:16px;\">\r\n					<span style=\"color:#000;font-size:12px;text-align:center;margin:10px;font-weight: bold;\">It\'s time to turn your dreams into reality.</span><br><br><img style=\"width: 150px;padding-right: 15px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/logo.png\" alt=\"[Image: ##SITE_NAME##]\" /></p>\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n	 </div>\r\n	 </center>\r\n</div>', null, 'SITE_NAME, SITE_URL, USERNAME, EXAM, EXAM_LINK', '0', '0', 'Start Skill Test Notification');
INSERT INTO `email_templates` VALUES ('79', '2017-01-05 12:16:22', '2017-01-05 12:16:22', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'contestpaymentpendingalert', 'if the contest is in payment pending status mail send to contest\nholder.', '[##CONTEST_NAME##] Payment pending', 'Dear ##USERNAME##,\n\n  Your contest \"##CONTEST_NAME##\" is currently under Inactive status due to pending payment.  You can pay the contest payment using the following URL, ##PENDING_PAYMENT_URL##.\n             If you fails to make a payment within ##PENDING_PAYMENT_DAYS## days, the contest leads to auto delete.\n\nThanks,\n ##SITE_NAME##\n ##SITE_URL##', '<div style=\"background: url(\'##SITE_URL##/images/login-background.jpg\');\">\r\n  <link href=\"http://fonts.googleapis.com/css?family=Open+Sans\" rel=\"stylesheet\" type=\"text/css\" />\r\n  <center><div style=\"margin: 5px 0pt; padding: 20px; width: 700px; font-family: Open Sans,sans-serif;background-repeat: no-repeat;-webkit-border-radius: 10px;-moz-border-radius: 10px;border-radius: 10px;\">\r\n	 <div style=\"border-bottom: 1px solid #ccc; margin: 0pt; background: -moz-linear-gradient(top, #fccd39 0%, #f49a2a 100%);\r\n		background: -webkit-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -o-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -ms-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#fccd39\', endColorstr=\'#f49a2a\',GradientType=0 ); \r\n		min-height: 70px;\">\r\n			<center><img style=\"margin-top: 15px;padding-right: 15px;width: 66px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/email.png\" alt=\"[Image: ##SITE_NAME##]\" /></center>\r\n	 </div>\r\n	 <div style=\"background: url(\'rose_bg2.png\') repeat;padding: 20px; background-color: #ffffff; box-shadow: 0 0 7px rgba(0, 0, 0, 0.067);\">\r\n		<table width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td style=\"padding: 20px 30px 5px;\">\r\n					Dear ##USERNAME##,<br />\n<br />\n  Your contest \"##CONTEST_NAME##\" is currently under Inactive status due to pending payment.  You can pay the contest payment using the following URL, ##PENDING_PAYMENT_URL##.<br />\n             If you fails to make a payment within ##PENDING_PAYMENT_DAYS## days, the contest leads to auto delete.<br />\n<br />\nThanks,<br />\n ##SITE_NAME##<br />\n ##SITE_URL##\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n		<table style=\"margin-top: 2px;\" width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td>\r\n					<p style=\" color: #000; font-size: 12px;text-align:center;line-height:16px;\">\r\n					<span style=\"color:#000;font-size:12px;text-align:center;margin:10px;font-weight: bold;\">It\'s time to turn your dreams into reality.</span><br><br><img style=\"width: 150px;padding-right: 15px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/logo.png\" alt=\"[Image: ##SITE_NAME##]\" /></p>\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n	 </div>\r\n	 </center>\r\n</div>', null, 'USERNAME, CONTEST_NAME, PENDING_PAYMENT_URL, PENDING_PAYMENT_DAYS, SITE_NAME, SITE_URL', '0', '1', 'Contest Payment Pending Alert');
INSERT INTO `email_templates` VALUES ('81', '2017-01-05 12:16:22', '2017-01-05 12:16:22', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'newcontestentry', 'We will send this mail to\ncontest owner, when a user posts a new entry.', 'There is a new entry for your contest!!!', 'Hi ##USERNAME##,\n\nYour contest ##CONTEST## got a new entry!!!\n\nClick the below link to check it out..\n\n##CONTEST##\nEntry Details:\nEntry No: ###ENTRY_ID##\nPosted User: #OTHER_USERNAME##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', '<div style=\"background: url(\'##SITE_URL##/images/login-background.jpg\');\">\r\n  <link href=\"http://fonts.googleapis.com/css?family=Open+Sans\" rel=\"stylesheet\" type=\"text/css\" />\r\n  <center><div style=\"margin: 5px 0pt; padding: 20px; width: 700px; font-family: Open Sans,sans-serif;background-repeat: no-repeat;-webkit-border-radius: 10px;-moz-border-radius: 10px;border-radius: 10px;\">\r\n	 <div style=\"border-bottom: 1px solid #ccc; margin: 0pt; background: -moz-linear-gradient(top, #fccd39 0%, #f49a2a 100%);\r\n		background: -webkit-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -o-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		background: -ms-linear-gradient(top, #fccd39 0%,#f49a2a 100%);\r\n		filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#fccd39\', endColorstr=\'#f49a2a\',GradientType=0 ); \r\n		min-height: 70px;\">\r\n			<center><img style=\"margin-top: 15px;padding-right: 15px;width: 66px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/email.png\" alt=\"[Image: ##SITE_NAME##]\" /></center>\r\n	 </div>\r\n	 <div style=\"background: url(\'rose_bg2.png\') repeat;padding: 20px; background-color: #ffffff; box-shadow: 0 0 7px rgba(0, 0, 0, 0.067);\">\r\n		<table width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td style=\"padding: 20px 30px 5px;\">\r\n					Hi ##USERNAME##,<br />\n<br />\nYour contest ##CONTEST## got a new entry!!!<br />\n<br />\nClick the below link to check it out..<br />\n<br />\n##CONTEST##<br />\nEntry Details:<br />\nEntry No: ###ENTRY_ID##<br />\nPosted User: #OTHER_USERNAME##<br />\n<br />\nThanks,<br />\n##SITE_NAME##<br />\n##SITE_URL##\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n		<table style=\"margin-top: 2px;\" width=\"100%\">\r\n		   <tbody>\r\n			  <tr>\r\n				 <td>\r\n					<p style=\" color: #000; font-size: 12px;text-align:center;line-height:16px;\">\r\n					<span style=\"color:#000;font-size:12px;text-align:center;margin:10px;font-weight: bold;\">It\'s time to turn your dreams into reality.</span><br><br><img style=\"width: 150px;padding-right: 15px; border: 0px 1px 0px 0px none solid none none -moz-use-text-color #333333 -moz-use-text-color -moz-use-text-color;\" src=\"##SITE_URL##/images/logo.png\" alt=\"[Image: ##SITE_NAME##]\" /></p>\r\n				 </td>\r\n			  </tr>\r\n		   </tbody>\r\n		</table>\r\n	 </div>\r\n	 </center>\r\n</div>', null, 'USERNAME,CONTEST_NAME,SITE_NAME,CONTEST_HOLDER,CONTEST_URL', '0', '1', 'New Contest Entry');
