INSERT INTO `jobs` VALUES ('1', '2017-04-29 12:39:38', '2017-04-29 12:55:19', '2', '4', '1', '15', 'Graphic Designing & 3D Rendering', 'graphic-designing-3d-rendering', '<p style=\"font-size: 13.3333px;\">Appreciation of the power of design is in everything we do. We believe, design is as much about behaviour and emotion, as it is about utility and ease. Our team enriches product direction and crafts pixel-perfect output that is simple, elegant and with a sense of caprice. Our engineering team moves swiftly to create extensive &amp; innovative ideas. Were playful, fun, helpful, and absolutely serious.</p><p style=\"font-size: 13.3333px;\">Sound like your type of space? Join us if you be the same too.</p><p style=\"font-size: 13.3333px;\">We are looking out for young and talented individual designers to join our team. He/ She should be well versed with PHOTOSHOP, ILLUSTRATOR/ CORAL DRAW &amp; 3DS MAX.</p><p style=\"font-size: 13.3333px;\">We are an Art &amp; Architecture company!Looking forward to bring the best of you.</p>', 'Long Island City, Queens, NY, USA', 'Long Island City', '351', '5493', '240', 'E152LL', '40.744679', '-73.948542', '30000', '50000', '2', '1', '2017-09-27', '20', 'Zeky design & technologies Pvt Ltd', '1', 'via_our_site', null, '0.00', '0.00', null, '1', null, null, '', '0', '0', '1', '1', '0', 'https://www.imp.com/careers', '3', '0', 'Long Island City,New York,New York,United States,E152LL', '15', '1', null, null, null, null);
INSERT INTO `jobs` VALUES ('2', '2017-04-29 12:50:36', '2017-04-29 12:55:21', '2', '4', '1', '15', 'Senior Graphic Designer', 'senior-graphic-designer', '<p style=\"font-size: 13.3333px;\">We are looking for a creative Graphic designer with up-to-date knowledge to interpret our clients needs and to design solutions with high visual impact. You will work on a variety of products, including websites, books, magazines, product packaging, websites, exhibitions, corporate identity etc. and you will cooperate with our designers and sales team.</p><p style=\"font-size: 13.3333px;\">The goal is to get the clients message across.</p><p style=\"font-size: 13.3333px;\"><b>Responsibilities</b></p><ul style=\"font-size: 13.3333px;\"><li>Cultivate a solid body of work</li><li>Take the design brief to record requirements and clients needs</li><li>Schedule project implementation and define budget constraints</li><li>Work with a wide range of media and use graphic design software</li><li>Think creatively and develop new design concepts, graphics and layouts</li><li>Prepare rough drafts and present your ideas</li><li>Amend final designs to clients comments and gain full approval</li><li>Work as part of a team with copywriters, designers, stylists, executives etc.</li></ul><p style=\"font-size: 13.3333px;\"><b>Requirements</b></p><ul style=\"font-size: 13.3333px;\"><li>Proven graphic designing experience</li><li>Possession of creative flair, versatility, conceptual/visual ability and originality</li><li>Demonstrable graphic design skills with a strong portfolio</li><li>Ability to interact, communicate and present ideas</li><li>Up to date with industry leading software and technologies (In Design, Illustrator, Dreamweaver, Photoshop etc)</li><li>Highly proficient in all design aspects</li><li>Professionalism regarding time, costs and deadlines</li></ul>', 'Via Industriale, 2/4, 25030 Corzano BS, Italy', 'Cidneo Meccanica S.R.L.', '356', '5499', '109', '25030', '45.449445', '10.010506', '20000', '40000', '2', '1', '2017-07-06', '20', 'Billion Creations Private Limited', '1', 'via_our_site', null, '0.00', '0.00', null, null, null, null, '', '0', '0', '1', '1', '0', 'https://www.imp.com/careers', '2', '0', 'Cidneo Meccanica S.R.L.,Lombardia,Lombardia,Italy,25030', '15', '1', null, null, null, null);
INSERT INTO `jobs` VALUES ('3', '2017-04-29 12:58:07', '2017-04-29 13:20:15', '2', '4', '1', '15', 'UX Developer in HTML 5, CSS 3, AngularJS, Jquery', 'ux-developer-in-html-5-css-3-angularjs-jquery', '<p style=\"font-size: 13.3333px;\"><b>Skills &amp; Qualifications</b></p><ul style=\"font-size: 13.3333px;\"><li>Proven work experience as a Front-end developer</li><li>Proficient understanding of web markup, including <b>HTML5, CSS3,</b> <b>JavaScript</b> and jQuery including CSS frameworks, such as <b>Material Design</b> and <b>Bootstrap</b></li><li>Basic understanding of server-side CSS pre-processing platforms, such as LESS and SASS</li><li>Good understanding of <b>advanced JavaScript libraries and frameworks, such as AngularJS</b></li><li><b>Good understanding of asynchronous request handling, partial page updates, and AJAX</b></li><li>Proficient understanding of browser testing and debugging.</li><li>Experience with testing frameworks, including Jasmine or Karma</li><li>Experience with a structured build, including Gulp or Grunt and NPM</li><li>Ability to perform well in a fast-paced environment</li></ul>', 'Newlands, Cape Town, 7700, South Africa', 'Newlands', '357', '5500', '209', '7700', '-33.978913', '18.448376', '50000', '60000', '2', '1', '2017-10-19', '30', 'Practo Technosoft India Pvt.Ltd', '1', 'via_our_site', null, '0.00', '0.00', null, null, null, null, '', '0', '2', '1', '1', '0', 'https://www.imp.com/careers', '7', '0', 'Western Cape,Western Cape,South Africa,7700', '15', '1', null, null, null, null);
INSERT INTO `jobs` VALUES ('4', '2017-04-29 13:01:31', '2017-04-29 13:20:37', '2', '4', '1', '15', 'Front End Developer - Angularjs, Bootstrap', 'front-end-developer-angularjs-bootstrap', '<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" style=\"font-size: 13.3333px;\"><tbody><tr><td class=\"snip\" style=\"width: 43em;\"><span id=\"job_summary\" class=\"summary\"></span><p>Greetings from Shell IT Services!</p><p>We have Urgent Requirements for a company located at Singapore. Please find the Job Description below.</p><p>Front End Developer - Angularjs, Bootstrap</p><p>Primary Skills:</p><ul><li>Ability to improve performance of website for both mobile and desktop</li><li>Come up with efficient, modular and scalable solutions for business and technical problems;</li><li>Design and architect technical solutions for the business problems of a large e-commerce portal;</li><li>Break projects into simpler granular tasks, estimate effort required and identify dependencies;</li><li>Write efficient and readable code leveraging on a good understanding of object oriented principles and design patterns;</li><li>Follow release cycles and commitment to deadlines;</li></ul><p><b>Skills Required :</b></p><ul><li>Languages : JavaScript/Node.js, HTML5, CSS3</li><li>Front end frameworks/libraries : jQuery, Handlebar, Bootstrap, Materialize</li><li>Good to have: Backbone, Angular, React, Webpack, Babel, familiar with ES6 syntax, Unit test cases</li><li>Atleast 2 years of experience.<br/></li></ul></td></tr></tbody></table>', 'Bejiharjo, Karangmojo, Gunung Kidul Regency, Special Region of Yogyakarta, Indonesia', 'Bejiharjo', '358', '5501', '103', 'E152LL', '-7.931687', '110.634771', '35000', '50000', '2', '1', '2017-11-22', '20', 'Vivo IT Services', '1', 'via_our_site', null, '0.00', '0.00', null, null, null, null, '', '0', '1', '1', '1', '0', 'https://www.imp.com/careers', '3', '0', 'Bejiharjo,Special Region of Yogyakarta,Special Region of Yogyakarta,Indonesia,E152LL', '15', '1', null, null, null, null);
INSERT INTO `jobs` VALUES ('5', '2017-04-29 13:06:22', '2017-04-29 13:06:22', '2', '3', '1', '23', 'Urgent Opening For Relationship Manager (Direct Sales)', 'urgent-opening-for-relationship-manager-direct-sales', '<p style=\"font-size: 13.3333px;\">Position: Relationship Manager</p><p style=\"font-size: 13.3333px;\">Industry: BFSI/ Insurance</p><p style=\"font-size: 13.3333px;\">Job Description:</p><ul style=\"font-size: 13.3333px;\"><li>Should have completed their graduation.</li><li>Only male candidates can apply for this position.</li><li>Candidates must have experience in Direct sales (Field work). From any industry can also apply</li><li>Preferably from BFSI &amp; Life Insurance can also apply.</li><li>Candidates must be Localate.</li><li>immediate joiner will be preferable</li></ul><p style=\"font-size: 13.3333px;\">Interested Candidates can forward your updated CV. Feel free to contact us</p>', 'New York, NY, USA', 'New York', '351', '5493', '240', 'E152LL', '40.712784', '-74.005941', '25000', '35000', '2', '0', '2017-11-30', '5', 'ESC Sales and Marketing', '1', 'via_our_site', null, '0.00', '0.00', null, null, null, null, '', '0', '0', '1', '1', '0', 'https://www.imp.com/careers', '0', '0', 'New York,United States,E152LL', '15', '1', null, null, null, null);
INSERT INTO `jobs` VALUES ('6', '2017-04-29 13:08:56', '2017-04-29 13:20:58', '3', '4', '1', '23', 'Require-Relationship Manager-With exp of Sales and Marketing', 'require-relationship-manager-with-exp-of-sales-and-marketing', '<p style=\"font-size: 13.3333px;\">Work in close contact with top management</p><p style=\"font-size: 13.3333px;\">Visit respective delegated areas for product marketing and sales</p><p style=\"font-size: 13.3333px;\">Ability to get money collection on time</p><p style=\"font-size: 13.3333px;\">Maintain good relations with other shopkeepers</p><p style=\"font-size: 13.3333px;\">Interest in the field of sales and marketing</p><p style=\"font-size: 13.3333px;\">Should have own personal two wheeler ( Petrol expenses will be reimbursed in full)</p><p style=\"font-size: 13.3333px;\">Extensive opportunities for growth and promotion</p><p style=\"font-size: 13.3333px;\">Great opportunity to develop oneself</p>', 'Chennai, Tamil Nadu, India', 'Chennai', '359', '5483', '102', '600116', '13.08268', '80.270718', '40000', '45000', '2', '0', '2017-08-30', '5', 'WSS GLOBAL PVT LTD', '1', 'via_our_site', null, '0.00', '0.00', null, null, null, null, '', '0', '0', '1', '1', '0', 'http://test.com/', '1', '0', 'Chennai,Tamil Nadu,India,600116', '15', '1', null, null, null, null);
INSERT INTO `jobs` VALUES ('7', '2017-04-29 13:13:29', '2017-04-29 13:21:10', '3', '4', '1', '6', 'Immediate Openings for Accountant', 'immediate-openings-for-accountant', '<p style=\"font-size: 13.3333px;\"><b>1)</b> Prepare, examine, and analyze accounting records, financial statements, and other financial reports to assess accuracy, completeness, and conformance to reporting and procedural standards.</p><p style=\"font-size: 13.3333px;\"><b>2)</b> Compute taxes owed and prepare tax returns, ensuring compliance with payment, reporting and other tax requirements.</p><p style=\"font-size: 13.3333px;\"><b>3)</b> Analyze business operations, trends, costs, revenues, financial commitments, and obligations, to project future revenues and expenses or to provide advice.</p><p style=\"font-size: 13.3333px;\"><b>4)</b> Report to management regarding the finances of establishment.</p><p style=\"font-size: 13.3333px;\"><b>5)</b> Establish tables of accounts, and assign entries to proper accounts.</p><p style=\"font-size: 13.3333px;\"><b>6)</b> Develop, maintain, and analyze budgets, preparing periodic reports that compare budgeted costs to actual costs.</p><p style=\"font-size: 13.3333px;\"><b>7)</b> Develop, implement, modify, and document record keeping and accounting systems, making use of current computer technology.</p><p style=\"font-size: 13.3333px;\"><b>8)</b> Prepare forms and manuals for accounting and bookkeeping personnel, and direct their work activities.</p><p style=\"font-size: 13.3333px;\"><b>9)</b> Survey operations to ascertain accounting needs and to recommend, develop, and maintain solutions to business and financial problems.</p>', 'Lahore, Pakistan', 'Lahore', '360', '5502', '169', '59760', '31.554606', '74.357158', '200000', '300000', '1', '1', '2017-11-30', '2', '5S Enterprises Pvt.Ltd', '1', 'via_our_site', null, '0.00', '0.00', null, null, null, null, '', '0', '1', '1', '1', '0', 'http://test.com/', '4', '0', 'Lahore,Punjab,Pakistan,59760', '15', '1'