INSERT INTO `message_contents` VALUES ('13', '2017-05-08 09:42:27', '2017-05-08 09:42:27', 'Commercial cleaning', 'This is for approximate. Please explain how many room and i will revise the quote after your response.');
INSERT INTO `message_contents` VALUES ('14', '2017-05-08 09:43:21', '2017-05-08 09:43:21', 'Commercial cleaning', 'It has 4 room and one hall. So $30 is okay right?');
INSERT INTO `message_contents` VALUES ('15', '2017-05-08 09:45:09', '2017-05-08 09:45:09', 'Commercial cleaning', 'Ya pricing is okay.... Once you hire I will start work ASAP');
INSERT INTO `message_contents` VALUES ('16', '2017-05-08 09:46:42', '2017-05-08 09:46:42', 'Commercial cleaning', 'Hello John Peter,\n\nI hired you, and so, can you please complete work by tomorrow morning? ');
INSERT INTO `message_contents` VALUES ('17', '2017-05-08 09:46:51', '2017-05-08 09:46:51', 'Commercial cleaning', 'And before 10 AM?');
