INSERT INTO `pages` VALUES ('2', '2009-07-11 11:16:54', '2018-11-28 19:35:35', null, 'About', '', '<div class=\"wrapper\"><div id=\"main-wrap\">\n    <div id=\"main\" class=\"clearfix\">\n    	<div class=\"content-width \">\n			<h2 class=\"main-title\">About us <span></span></h2>\n			<div class=\"find-project\">\n				<h3>Find the Best Project</h3>\n				<div class=\"clearfix\">\n					<div class=\"about-left-info\">\n						<img src=\"images/quote-img.png\" alt=\"\">\n						<p>At Website.com, we believe everyone deserves to have a website or online store. Innovation and simplicity makes us happy: our goal is to remove any technical or financial barriers that can prevent business owners from making their own website. We\'re excited to help you on your journey!</p>\n						<p>At Website.com, we believe everyone deserves to have a website or online store. Innovation and simplicity makes us happy: our goal is to remove any technical or financial barriers that can prevent business owners from making their own website. We\'re excited to help you on your journey!</p>\n					</div>\n					<div class=\"about-info-img\">\n						<img src=\"images/about-info-img.jpg\" alt=\"\">\n					</div>\n				</div>\n			</div>\n		</div>\n    </div>\n	<!--Social Media start -->\n	<ul class=\"social-nav\">\n		<li><a href=\"#\"><img src=\"images/social-icon1.png\" alt=\"\"></a></li>\n		<li><a href=\"#\"><img src=\"images/social-icon2.png\" alt=\"\"></a></li>\n		<li><a href=\"#\"><img src=\"images/social-icon3.png\" alt=\"\"></a></li>\n		<li><a href=\"#\"><img src=\"images/social-icon4.png\" alt=\"\"></a></li>\n		<li><a href=\"#\"><img src=\"images/social-icon5.png\" alt=\"\"></a></li>\n	</ul>\n	<!--Social Media end -->\n</div></div>', null, 'about.ctp', '0', null, null, '0', null, null, null, 'about', '0');
