ditions', '0');
INSERT INTO `pages` VALUES ('9', '2011-06-24 16:55:35', '2011-10-07 05:42:07', null, 'Privacy', '', '<p>For each visitor to our Web page our Web server automatically recognizes no information regarding the domain or e-mail address.</p><p>We collect the e-mail addresses of those who post messages to our bulletin board the e-mail addresses of those who communicate with us via e-mail the e-mail addresses of those who make postings to our chat areas user-specific information on what pages consumers access or visit information volunteered by the consumer such as survey information and/or site registrations name and address telephone number.</p><p>The information we collect is disclosed when legally required to do so at the request of governmental authorities conducting an investigation to verify or enforce compliance with the policies governing our Website and applicable laws or to protect against misuse or unauthorized use of our Website to a successor entity in connection with a corporate merger consolidation sale of assets or other corporate change respecting the Website.</p><p>With respect to cookies. We use cookies to record session information such as items that consumers add to their shopping cart.</p><p>If you do not want to receive e-mail from us in the future please let us know by sending us e-mail at the above address.</p><p>Persons who supply us with their telephone numbers on-line will only receive telephone contact from us with information regarding orders they have placed on-line. Please provide us with your name and phone number. We will be sure your name is removed from the list we share with other organizations.</p><p>With respect to Ad Servers. We do not partner with or have special relationships with any ad server companies.</p><p>From time to time we may use customer information for new unanticipated uses not previously disclosed in our privacy notice. If our information practices change at some time in the future we will post the policy changes to our Web site to notify you of these changes and we will use for these new purposes only data collected from the time of the policy change forward. If you are concerned about how your information is used you should check back at our Web site periodically.</p><p>Upon request we provide site visitors with access to transaction information (e.g. dates on which customers made purchases amounts and types of purchases) that we maintain about them.</p><p>Upon request we offer visitors the ability to have inaccuracies corrected in contact information transaction information.</p><p>With respect to security. When we transfer and receive certain types of sensitive information such as financial or health information we redirect visitors to a secure server and will notify visitors through a pop-up screen on our site.</p><p>If you feel that this site is not following its stated information policy you may contact us at the above addresses or phone number.</p>\r\n', null, null, '0', null, null, '0', null, '', '/privacy', 'privacy', '0');
