INSERT INTO `pages` VALUES ('15', '2011-04-01 20:05:15', '2011-04-01 20:05:15', null, 'Acceptable Use Policy', '', '<p>You are independently responsible for complying with all applicable  laws in all of your actions related to your use of PayPal&rsquo;s services,  regardless of the purpose of the use. In addition, you must adhere to  the terms of this Acceptable Use Policy.</p>\r\n<p><strong>Prohibited Activities</strong></p>\r\n<p>You may not use the PayPal service for activities that:</p>\r\n<ol>\r\n<li> violate any law, statute, ordinance or regulation </li>\r\n<li> relate to sales of (a) narcotics, steroids, certain  controlled substances or other products that present a risk to consumer  safety, (b) drug paraphernalia, (c) items that encourage, promote,  facilitate or instruct others to engage in illegal activity, (d) items  that promote hate, violence, racial intolerance, or the financial  exploitation of a crime, (e) items that are considered obscene, (f)  items that infringe or violate any copyright, trademark, right of  publicity or privacy or any other proprietary right under the laws of  any jurisdiction, (g) certain sexually oriented materials or services,  (h) ammunition, firearms, or certain firearm parts or accessories, or  (i) certain weapons or knives regulated under applicable law </li>\r\n<li> relate to transactions that (a) show the personal information  of third parties in violation of applicable law, (b) support pyramid or  ponzi schemes, matrix programs, other &ldquo;get rich quick&rdquo; schemes or  certain multi-level marketing programs, (c) are associated with  purchases of real property, annuities or lottery contracts, lay-away  systems, off-shore banking or transactions to finance or refinance debts  funded by a credit card, (d) are for the sale of certain items before  the seller has control or possession of the item, (e) are by payment  processors to collect payments on behalf of merchants, (f) are  associated with the following Money Service Business Activities: the  sale of traveler&rsquo;s cheques or money orders, currency exchanges or cheque  cashing, or (g) provide certain credit repair or debt settlement  services </li>\r\n<li> involve the sales of products or services identified by government agencies to have a high likelihood of being fraudulent </li>\r\n<li>violate applicable laws or industry regulations regarding the  sale of (a) tobacco products, or (b) prescription drugs and devices</li>\r\n<li> involve gambling, gaming and/or any other activity with an  entry fee and a prize, including, but not limited to casino games,  sports betting, horse or greyhound racing, lottery tickets, other  ventures that facilitate gambling, games of skill (whether or not it is  legally defined as a lottery) and sweepstakes unless the operator has  obtained prior approval from PayPal and the operator and customers are  located exclusively in jurisdictions where such activities are permitted  by law. </li>\r\n</ol>', null, null, '0', null, null, '0', null, null, '/aup', 'aup', '0');
