INSERT INTO `pages` VALUES ('22', '2018-11-29 18:01:02', '2018-11-29 18:13:12', null, 'Freelancer Work', null, '<div class=\"wrapper\"><div id=\"main-wrap\">\n    <div id=\"main\" class=\"clearfix\">\n    	<div class=\"content-width \">\n			<h2 class=\"main-title\">How Does FreelanceEngine work? <span></span></h2>\n			<div class=\"freelan-work-sec\">\n				<img src=\"images/freelan-work.png\" alt=\"\" class=\"main-img\">\n				<ul class=\"clearfix\">\n					<li class=\"heading1\">\n						<span><em>01</em><img src=\"images/new-themes/work-icons1.jpg\" alt=\"\"></span>\n						<h4>Post projects to tell us <br>what  you  need  done</h4>\n					</li>\n					<li class=\"heading2\">\n						<span><em>02</em><img src=\"images/work-icons2.jpg\" alt=\"\"></span>\n						<h4>Browse  profiles, reviews then <br>hire a farorite and start project</h4>\n					</li>\n					<li class=\"heading3\">\n						<span><em>03</em><img src=\"images/work-icons4.jpg\" alt=\"\"></span>\n						<h4>Use FreelaneEngine platform to <br>chat and share files</h4>\n					</li>\n					<li class=\"heading4\">\n						<span><em>04</em><img src=\"images/work-icons3.jpg\" alt=\"\"></span>\n						<h4>With our protection, only <br>payfor work you authorize</h4>\n					</li>\n				</ul>\n			</div>\n		</div>\n    </div></div></div>', null, null, null, null, null, '0', null, null, null, 'freelancer-work', '1');
INSERT INTO `pages` VALUES ('23', '2018-11-30 18:29:44', '2018-11-30 18:32:17', null, 'services', null, '<div class=\"wrapper\"><div id=\"main-wrap\">\n    <div id=\"main\" class=\"clearfix\">\n    	<div class=\"content-width \">\n			<h2 class=\"main-title\">The Level of Services <span></span></h2>\n			<div class=\"find-project service-sec\">\n				<h3>Select the level of service you need for project posting</h3>\n				<div class=\"clearfix\">\n					<div class=\"service-box\">\n						<div class=\"service-box-info\">\n							<div class=\"box-head\">\n								<h3>FREE <br>for 5 days</h3>\n							</div>\n							<div class=\"box-body\">\n								<h3>FREE</h3>\n								<p>You have 3 times to submit a free project. Each project will be displayed as normal for 5 days</p>\n							</div>\n							<div class=\"box-footer\">\n								<a href=\"#\">Sign up</a>\n							</div>\n						</div>\n					</div>\n					<div class=\"service-box\">\n						<div class=\"service-box-info\">\n							<div class=\"box-head\">\n								<h3>$10 <br>for 30 days</h3>\n							</div>\n							<div class=\"box-body\">\n								<h3>STANDARD</h3>\n								<p>You have 3 times to submit a free project. Each project will be displayed as normal for 5 days</p>\n							</div>\n							<div class=\"box-footer\">\n								<a href=\"#\">Sign up</a>\n							</div>\n						</div>\n					</div>\n					<div class=\"service-box\">\n						<div class=\"service-box-info\">\n							<div class=\"box-head\">\n								<h3>$20 <br>for 40 days</h3>\n							</div>\n							<div class=\"box-body\">\n								<h3>PREMIUM</h3>\n								<p>You have 3 times to submit a free project. Each project will be displayed as normal for 5 days</p>\n							</div>\n							<div class=\"box-footer\">\n								<a href=\"#\">Sign up</a>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n		</div>\n    </div></div></div>', null, null, null, null, null, '0', null, null, null, 'services', '1');
