INSERT INTO `projects` VALUES ('4', '2017-04-28 07:38:06', '2018-09-11 14:13:09', '2', '4', '2', 'Wordpress Website Optimization', 'wordpress-website-optimization', 'I am looking for a developer with expertise in optimising Wordpress websites for speed. I have several of our clients\' websites that aren\'t as fast as we would like them to be and aren\'t getting good enough results in GTMETRIX tests.\r\nHours of work: 6 Hr / week', '10', null, null, null, '90', '1', '0', '0', '0', '0', '1', '0', '0', '0', null, null, null, '0', '1', '0', null, null, null, null, '1', '1', '0', '0', '0', null, null, '0', '0', '0', '0', '0', '0', '7', '0', null, null);
INSERT INTO `projects` VALUES ('5', '2017-04-28 07:40:34', '2017-07-08 07:48:03', '2', '3', '2', 'I need some Graphic Design', 'i-need-some-graphic-design', 'We need some high-quality product photo for our store. I have uploaded a photo and some sample pictures. I need the photo to look like sample pictures quality. We have 1000s of item to do. But first, please send me the sample work before we proceed.\r\n\r\nTask: Edit the picture [17909300.....] with true colur. After bidding, please send me the work before I award you.', '10', null, null, null, '60', '0', '0', '0', '0', '0', '1', '0', '0', '0', null, null, null, '0', '1', '0', null, null, 'c862fb22-ec00-4cc2-9ca9-e3f4ae7d7cbc', null, '1', '1', '0', '0', '0', null, null, '0', '0', '0', '0', '0', '0', '4', '0', null, null);
INSERT INTO `projects` VALUES ('6', '2017-04-28 07:42:27', '2017-07-08 07:49:16', '2', '1', '4', 'Mobile App Android, iOS', 'mobile-app-android-ios', 'I need an Android &amp; iOS app like ShareIt..\r\n1. front end unique design,\r\n2. Functionality working as much as Same or better in ShareIt,\r\n3. I including app advertisement, Admob, applovin, chart post ads space.\r\n4. Need Without any bug Issue\r\n5. unique Logo,\r\n6. in app purchase\r\n7. Admin panels, can change logo, ads space, Etc\r\n8. Other details request upon with selected Freelancer', '5', null, null, null, '90', '1', '0', '0', '0', '1', '1', '0', '0', '0', null, null, null, '0', '0', '0', null, null, null, null, '1', '1', '0', '0', '0', null, null, '0', '0', '0', '0', '0', '0', '2', '0', null, null);
