INSERT INTO `settings` VALUES ('525', '2016-12-19 12:51:40', '2016-12-19 12:51:40', '128', 'IS_ALLOW_TO_RECONTINUE_SKILL_TEST', '1', 'If disabled mean, user can\'t recontinue the test if skipping test in between the time due to internet connection broken, or pressing browse back button etc. ', 'checkbox', 'Allow User to Recontinue the Skill Test?', '1', null, '1');
INSERT INTO `settings` VALUES ('528', '2016-12-19 13:06:01', '2016-12-19 13:06:01', '0', 'IS_ENABLED_EXPIRE_TIME_FOR_EXAM', '0', 'If we enable \\\\\"Allow User to re-continue the skill test?\\\\\", we can specify an expiry time for the skill test in add and edit the form. <br /> E.g., Let\'s take the test duration is 30 minutes and we shall mention 15 minutes as an expiry time. If the user gets disconnected, he can \\\\\"Re-continue\\\\\" the test and \\\\\"Answer the questions\\\\\" but he will get the remaining time of partially completed test. <br /><br />\\n\\nE.g. #1: A user starts the exam at 11:00 AM and takes a 10 minute break after 11:10 AM. Again, they restarted it by 11:20  AM. After calculating the disconnected time and the partially completed test timings a find out the remaining test time (says 20 minutes and 5 minutes of expiry time is left out). The system will display the remaining time for completing the examination. <br /><br />\\n\\nE.g. #2: User starts the exam at 11:00 AM and he disconnects from 11:10 AM. Again, they restarted the test by 11:30 AM (20 minutes break). So the system displays the remaining test time 15 minutes for the completion of the test. As he has an expiry time of 15 minutes and also he took 5 minutes extra break time. In that case, he lost 5 minutes of his exam time. In total, the remaining time left for the completion of exam is just 15 minutes.<br /><br />\\n\\nNote: If we give more time, they may try any kinds of irregular activities. If it is disabled, users can re-continue the exam but no grace time will be given and will not get any compensation for his lost time. ', 'checkbox', 'Enable Expire Time Setting?', '1', null, '0');
INSERT INTO `settings` VALUES ('529', '2016-12-19 13:09:48', '2016-12-19 13:09:48', '128', 'IS_FEE_NEEDED_FOR_RERATTEMPTS', '1', 'Disable this, if no need for skill test fee for reattempting failed test.', 'checkbox', 'Enable Skill Test Fee for Reattempts?', '1', null, '0');
