INSERT INTO `settings` VALUES ('531', '2016-12-19 13:16:54', '2016-12-19 13:16:54', '128', 'MAX_NUMBER_OF_TIME_PER_USER_PER_EXAM', '3', 'This is the maximum number, to allow a user to reattempts same skill test. Leave blank for no limit. Enter 0 for no reattempts', 'text', 'Maximum Number of Time User Can Reattempt Same Skill Test.', '1', null, '0');
