INSERT INTO `settings` VALUES ('617', '2017-05-19 11:29:32', '2017-05-19 11:29:32', '11', 'SENDING_QUOTE_REQUEST_FLOW_TYPE', 'Send to All Relevant Service Provider', 'When run with \"Send to All Relevant Service Provider\", system will send quote request to all relevant service providers at a time. When run with \"Rating Basis\", system will send quote request to relevant service provider by rating basis. If we set as \"Quote Request Send Upto\" 3 mean, only greater or equal to 3 rating service provider\'s can got the quote requests. After \"Time Limit After Other Provider Getting Quote Request\" system will send quote request to other provider. If we set as \"Limited Quote Per Limited Period\" mean, system will quote request to all relevent service provider at a time. But only quote requestor can see limited quotes in particular period. After that period, requestor can see all quotes. We can set limit in \"Quote Visible Limit\" and time period in \"Time Limit After Other Provider\'s Quote visible to Requestor\".', 'select', 'Quote Request Sending Type', '1', 'Send to All Relevant Service Provider,Rating Basis,Limited Quote Per Limited Period', '1');
