INSERT INTO `users` VALUES ('2', '2016-10-27 10:56:11', '2019-04-08 21:41:02', '2', 'user1', 'productdemo.user+user1@gmail.com', '$2y$12$fvZ3bTdxz8TnNwvmQ5zW..YZNOr9YKSiMby0ShGVVh4FeCX3ZIEUS', '5', '3', '49', '10', '0', '0', '0', '0', '2781.1', null, null, null, '1', '1', '1', '0', '5', '1', '8', '0', '0', '2', '0', '0', '0', null, '491', '500', 'John', 'Peter', null, null, '1', '0', '0', '107', '48.9', '440.1', '6', '2', '0', '5', '1', '0', '0', '1', '1', '1', '0', null, null, '351', '5493', '240', null, null, null, 'Long Island City, Queens, NY, USA', '0', '1', '10', '227', '1', '0', 'Project Manager', 'Do you need a professional editor and writer to proofread your technical document, thesis, novel, statement of purpose, personal statement, resume, cover letter, manuscript, essay, short story, textbook content, article, and marketing material ensuring their content is flawless and appealing to readers? \r\n\r\nWhy Hire Me?\r\n1. I have a 5 star average rating for 2544+ projects completed on freelancer.\r\n2. I am a creative writer. \r\n3. I hold a master\'s degree in Computer Science.\r\n4. High quality work in a timely manner.\r\n\r\nSome Details About Me:\r\n\r\nI am a professional editor (academic, copy, line/substantive and technical editing) and proofreader offering a wealth of experience editing a wide variety of written material. I strive for complete accuracy and the highest degree of professionalism in the work I complete. QUALITY is my second name.\r\n\r\nFrom college entrance essays to business documents and everything in between, I can take your written material from drab to fab!', '-30', '1', null, null, null, null, null);
INSERT INTO `users` VALUES ('3', '2016-10-27 12:48:04', '2019-03-04 13:05:48', '2', 'user2', 'productdemo.user+user2@gmail.com', '$2y$12$RjmIvN7glrrJh8u/YPFNVO47a0oOmWgCDsxvz78ABXUELlaO5zcJe', '4', '2', '21', '3', '0', '0', '0', '0', '2144', null, null, null, '1', '1', '1', '0', '2', '1', '4', '0', '0', '2', '0', '0', '0', null, '496', '500', 'Michael', 'Kors', null, null, '1', '0', '2', '30', '186', '144', '6', '2', '0', '0', '0', '5', '1', '1', '2', '0', '1', null, null, '352', '5494', '240', null, null, null, '221 S 5th Ave, Highland Park, NJ 08904, USA,Highland Park NJ Municipal Court,New Jersey,New Jersey,,8904', '0', '1', '10', '30', '0', '0', 'Senior Developer', 'Thank you for visiting our profile page.\r\n\r\nWe are Web designers, Database, eCommerce, Salesforce Developers based in The USA.\r\n\r\nWe work across all industries and with small, medium and large businesses.\r\n\r\nOur skills include:\r\n- Microsoft Access, MS SQL Server, MySQL\r\n- iPhone App Development (Objective-c, Swift)\r\n- Salesforce App Development, APEX, VisualForce\r\n- .Net, PHP, HTML, CSS, Scripting\r\n- Volusion, Bigcommerce, Shopify, Magento\r\n- WordPress\r\n- Graphic Design, Interface Design\r\n- Python, Django', '-50', '1', null, null, null, null, null);
